VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 'ing arthritis include having a previous joint injury, obesity, or lupus. How is arthritis diagnosed? To find out if you have arthritis, your health care provider may: Ask you about your medical history, including your symptoms. Do a physical exam. Order blood tests or take x-rays. Your provider may refer you to a rheumatologist (a doctor who specializes in arthritis care) for tests, diagnosis, and care. What are the treatments for arthritis? Treatment depends on the type of arthritis you have. It may include medicine or surgery. Your provider will work with you to improve your symptoms and quality of life.', '{0.429747998714447,-0.057693056762218475,0.2628679871559143,-0.4665009081363678,-0.5286542177200317,0.7823132276535034,-0.32953372597694397,1.308738350868225,-0.633682131767273,-0.8152442574501038,0.3346959948539734,0.2052191197872162,0.9186326861381531,-0.179401695728302,-0.35015586018562317,0.21995756030082703,-0.10180278867483139,-0.18213562667369843,0.11143690347671509,0.1456528604030609,-0.5353224277496338,-0.4899669289588928,-0.21358226239681244,0.3340229094028473,0.47239556908607483,0.19925084710121155,-0.9048470258712769,-0.5486010313034058,0.6196666955947876,0.11734120547771454,-0.2890605628490448,0.7009518146514893,-0.17043593525886536,0.1617155373096466,-0.13920632004737854,-0.31900426745414734,-0.2252962589263916,0.22640521824359894,-0.7621140480041504,-0.36604321002960205,-0.008313026279211044,0.8604188561439514,-0.4964110553264618,-0.5784339308738708,-0.17197716236114502,1.0298088788986206,0.886804461479187,-0.019263818860054016,0.020066488534212112,-0.24369372427463531,0.04253064841032028,-0.14460624754428864,-0.5233910083770752,0.09089560061693192,0.032930146902799606,0.06829558312892914,0.001451199990697205,-0.32316604256629944,0.2162516713142395,0.009202050976455212,0.24690032005310059,0.2962895929813385,0.0543786883354187,-0.6559853553771973,-0.7973219156265259,1.06098091