VALUES ('MedlinePlus:  E P I L E P S Y ', 'Epilepsy On this page Basics Summary Start Here Diagnosis and Tests Treatments and Therapies Learn More Living With Related Issues Specifics Genetics See, Play and Learn Images Research Statistics and Research Clinical Trials Journal Articles Resources Find an Expert For You Children Teenagers Women Patient Handouts Summary Epilepsy is a brain disorder that causes people to have recurring seizures. The seizures happen when clusters of nerve cells, or neurons, in the brain send out the wrong signals. People may have strange sensations and emotions or behave strangely. They may have violent muscle spasms or lose consciousness. Epilepsy has many possible causes, including illness, brain injury, and abnormal brain development. In many cases, the cause is unknown. Doctors use brain scans and other tests to diagnose epilepsy. It is important to start treatment right away. There is no cure for epilepsy, but medicines can control seizures for most people. When medicines are not working well, surgery or implanted devices such as vagus nerve stimulators may help. Special diets can help some children with epilepsy. NIH: National Institute of Neurological Disorders and Stroke Start Here About Epilepsy (Department of Veterans Affairs) Epilepsy and Seizures (National Institute of Neurological Disorders and Stroke) Diagnosis and Tests EEG (Electroencephalogram) (Mayo Foundation for Medical Education and Research) Functional MRI (fMRI) (American College of Radiology;

