VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'sthma triggers may be different for each person and can change over time. Who is at risk for asthma? Asthma affects people of all ages, but it often starts during childhood. Certain factors can raise your risk of having asthma: Being exposed to secondhand smoke when your mother is pregnant with you or when you are a small child Being exposed to certain substances at work, such as chemical irritants or industrial dusts Genetics and family history. You are more likely to have asthma if one of your parents has it, especially if it''s your mother. Race or ethnicity. Black and African Americans and Puerto Ricans are at higher risk of asthma than people of other races or ethnicities. Having other diseases or conditions such as obesity and allergies Often having viral respiratory infections as a young child Sex. In children, asthma is more common in boys. In teens and adults, it is more common in women. What are the symptoms of asthma?', '{0.6727665066719055,-0.4956609010696411,-0.19255465269088745,-0.39610275626182556,-0.04435422644019127,1.079019546508789,0.1079384982585907,0.3559768497943878,0.2395264208316803,-0.49294301867485046,0.5074084401130676,0.16169853508472443,-0.18256935477256775,-0.9658007621765137,-0.27599838376045227,0.22383533418178558,0.5318508148193359,0.19044487178325653,0.4163065552711487,-0.6562651991844177,-0.6029093861579895,-0.8468832969665527,0.13419996201992035,0.488257497549057,-0.7562754154205322,0.579196572303772,-0.660086452960968,-0.5842266082763672,0.24492238461971283,-0.018692366778850555,-0.878540575504303,-0.22224801778793335,-0.22006376087665558,0.6763489246368408,-0.24371621012687683,0.09800408035516739,-0.15324290096759796,0.5254697799682617,-0.5007075667381287,-0.5872227549552917,-0.062444478273391724,0.6138479709625244,0.14689037203788757,-0.6537625193595886,-0.8679214119911194,0.7641672492027283,0.5204269886016846,-0.43259090185165405,-0.03136690333485603,1.030