VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 're common in boys. In teens and adults, it is more common in women. What are the symptoms of asthma? The symptoms of asthma include: Chest tightness Coughing, especially at night or early morning Shortness of breath Wheezing, which causes a whistling sound when you breathe out These symptoms can range from mild to severe. You may have them every day or only once in a while. When you are having an asthma attack, your symptoms get much worse. The attacks may come on gradually or suddenly. Sometimes they can be life-threatening. They are more common in people who have severe asthma. If you are having asthma attacks, you may need a change in your treatment. How is asthma diagnosed? Your health care provider may use many tools to diagnose asthma: Physical exam Medical history Lung function tests, including spirometry, to test how well your lungs work Tests to measure how your airways react to specific exposures.', '{0.8112099170684814,-0.7561120390892029,-0.1926320195198059,-0.748325526714325,0.08738455176353455,1.411568522453308,0.0531034953892231,0.28653258085250854,0.38478368520736694,-0.8472251296043396,0.3645589351654053,0.3770774006843567,-0.06652109324932098,-0.8207034468650818,-0.3906337022781372,0.4735512435436249,0.4140583276748657,0.3246857821941376,0.4595003128051758,-0.1600652039051056,-0.7306603789329529,-0.7060106992721558,-0.07250156253576279,-0.02811303921043873,-0.42260339856147766,0.7855559587478638,-1.0529217720031738,-0.3736353814601898,0.1971776932477951,-0.278166800737381,-0.39180105924606323,-0.28620266914367676,-0.6259379982948303,-0.17031234502792358,-0.026865633204579353,-0.027687881141901016,-0.3197079002857208,0.4435761570930481,-0.9354881048202515,-0.27723050117492676,0.14596527814865112,1.8648695945739746,-0.3269122540950775,-0.7496277093887329,-0.20493368804454803,0.33514198660850525,0.5018952488899231,-0.4904402792453766,0.20766772329807281,0.7371674180030823,-0.57067