VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 5, 'nage your asthma symptoms and prevent asthma attacks. It will include: Strategies to avoid triggers. For example, if tobacco smoke is a trigger for you, you should not smoke or allow other people to smoke in your home or car. Short-term relief medicines, also called quick-relief medicines. They help prevent symptoms or relieve symptoms during an asthma attack. They include an inhaler to carry with you all the time. It may also include other types of medicines which work quickly to help open your airways. Control medicines. You take them every day to help prevent symptoms. They work by reducing airway inflammation and preventing narrowing of the airways. If you have a severe attack and the short-term relief medicines do not work, you will need emergency care. Your provider may adjust your treatment until asthma symptoms are controlled. Sometimes asthma is severe and cannot be controlled with other treatments.', '{0.6305661201477051,-0.48889151215553284,-0.36080023646354675,-0.6513924598693848,0.46759533882141113,1.6412855386734009,0.007443733047693968,0.24779079854488373,0.5000684261322021,-1.0229865312576294,0.29506218433380127,0.2270830273628235,-0.15271875262260437,-1.031115174293518,-0.27474257349967957,0.4618411362171173,0.6578643321990967,-0.012418698519468307,0.4382108151912689,-0.16057181358337402,-0.8640598654747009,-0.50412917137146,-0.10226289927959442,-0.04794462397694588,0.004564350005239248,0.40537968277931213,-0.7906235456466675,-0.4088117480278015,0.2629518210887909,-0.4435063898563385,-0.41422128677368164,0.08251237869262695,-0.6397251486778259,0.21169738471508026,-0.513828456401825,-0.19439639151096344,-0.5574486255645752,0.520720899105072,-0.7071017622947693,-0.2964622676372528,0.05641913414001465,1.4915857315063477,-0.504371702671051,-0.8129625916481018,-0.3582211136817932,-0.10845736414194107,0.22125060856342316,-0.36665791273117065,-0.3437875211238861,0.7564504146575928,-0.1