VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 6, 'symptoms are controlled. Sometimes asthma is severe and cannot be controlled with other treatments. If you are an adult with uncontrolled asthma, in some cases your provider might suggest bronchial thermoplasty. This is a procedure that uses heat to shrink the smooth muscle in the lungs. Shrinking the muscle reduces your airway''s ability to tighten and allows you to breathe more easily. The procedure has some risks, so it''s important to discuss them with your provider. Start Here About Asthma (Centers for Disease Control and Prevention) Also in Spanish Asthma (National Institute of Environmental Health Sciences) What Is Asthma? (Environmental Protection Agency) What Is Asthma?', '{0.6446475386619568,-0.6042366623878479,0.05509123578667641,-0.44750434160232544,0.2081446796655655,1.0453547239303589,-0.1516733467578888,0.04218797758221626,0.3487953543663025,-0.7172897458076477,0.2771430015563965,-0.12037543207406998,-0.027811262756586075,-0.9717493057250977,-0.06091948598623276,0.1270485818386078,1.017351508140564,-0.10576292872428894,0.43656614422798157,-0.23378698527812958,-0.41946110129356384,-0.5387730002403259,-0.12469764053821564,-0.16697733104228973,0.008937357924878597,0.9238689541816711,-0.7615607380867004,-0.37792134284973145,-0.06774217635393143,-0.14428077638149261,-0.7435389161109924,0.09458496421575546,-0.1956508457660675,0.15041719377040863,-0.17223156988620758,0.11569026112556458,-0.7047395706176758,-0.10283888131380081,-0.8212599158287048,-0.5056588053703308,-0.040756531059741974,1.4064674377441406,-0.6086702346801758,-0.251916766166687,-0.06211964413523674,-0.08747351169586182,0.38804158568382263,-0.5006818771362305,0.2155918926000595,0.6260790228843689,-0.8366677165031433,0.03245600312948227,-0.38121044635772705,0.37041279673576355,-1.6169530153274536,0.16549842059612274,0.09189276397228241,0.08740174025297165,0.7126957178115845,0.23863615095615387,0.49718689918518066,-0.318090